description:
Đây là một trong những ngôi nhà đáng tiền nhất phường Phú Thượng, Tây Hồ;
Bán kính 300 m có mọi thứ: trường cấp 1- cấp 2_cấp 3, cây xăng Lạc Long Quân -ngân hàng nhiều vô số khu Sunshine, chợ Phú Gia, bãi ô tô sân chơi Phú Xá, nhà hàng khu Ciputra, trung tâm thương mai Lotte (đang hoàn thiện);
Ngõ thông thoáng, nhấn ga ra An Dương Vương, cầu Nhật Tân, đường Võ Chí Công;
Thiết kế:
- Tầng 1: khách + bếp+wc;
- Từ tầng 2: phòng ngủ rộng, wc, có ban công;
- Tầng thượng: phòng thờ+sân phơi;
Sổ đỏ chính chủ giao dịch ngay.
